import React, { Component } from 'react';
import axios from 'axios';
import './App.css';

const api = {
  baseUrl: 'http://localhost:8080'
}

class App extends Component {
  constructor() {
    super();
    this.state = {
      apiData: []
    }
  }

  componentDidMount() {
    axios.get(api.baseUrl).then(res => {
      console.log('resp', res)
    })
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }

}

export default App;
